import React  from "react";
import{component} from 'react'
import PosteNote from "./PosteNote";

function PosteList({todos, onChange, onDelete, onEdit})  {
    return <>
        {todos.map((todo) =>
            <PosteNote key={todo.id} todo={todo} onChange={onChange}
             onDelete={onDelete} onEdit={onEdit}></PosteNote>
        )}
    </>
}

export default PosteList
